    and gas fields in California provides a significant and consistent source of information
    which can be used to evaluate geopressure. A total of 410 pools have pressure gradients
    exceeding 0.45 psi/foot; these are considered to be potentially geopressured. At
    least 70 of these have pressures distinctly higher than predicted by the regional
    hydro static gradient, and 8 pools are super pressured.",nt"license_title":
